<!DOCTYPE HTML>
<html><head><style>.da-code {   font-family: monospace; line-height: 1.1em; white-space: pre; padding: 10px;   position: absolute; width: 100%; height: 100%; } .da-hl-error { color: var(--vscode-terminal-ansiBrightRed); } .da-hl-warning { color: var(--vscode-terminal-ansiYellow); } .da-hl-operator { color: var(--vscode-terminal-ansiRed); } .da-hl-keyword { color: var(--vscode-terminal-ansiGreen); } .da-hl-type { color: var(--vscode-terminal-ansiBrightYellow); } .da-hl-comment { color: var(--vscode-terminal-ansiWhite); } .da-hl-parens { color: var(--vscode-terminal-ansiYellow); } .da-hl-predicate { color: var(--vscode-terminal-ansiMagenta); } .da-hl-constructor { color: var(--vscode-terminal-ansiBrightBlue); } .da-hl-proof-step { color: var(--vscode-terminal-ansiBlue); } .da-hl-link { color: var(--link-color); text-decoration: underline; cursor: pointer; } .da-hl-nobr { white-space: pre; }</style><style>table, th, td {
  border: 1px solid;
  border-collapse: collapse;
}
th, td {
  padding-left: 2px;
  padding-right: 2px;
}
body.hide_archived .archived {
  display: none;
}
body.hide_table .table {
  display: none;
}
body.hide_transaction .transaction {
  display: none;
}
tr.archived td {
  text-decoration: line-through;
}
td.disclosure {
  max-width: 1em;
  text-align: center;
}
tr.archived td.disclosure {
  text-decoration: none;
}
th {
  vertical-align: bottom;
}
div.observer {
  max-width: 1em;
  writing-mode: vertical-rl;
  transform: rotate(180deg);
}
</style><script>function show_archived_changed() {
  document.body.classList.toggle('hide_archived', !document.getElementById('show_archived').checked);
}
function toggle_view() {
  document.body.classList.toggle('hide_transaction');
  document.body.classList.toggle('hide_table');
}
</script></head><body><div class="da-code transaction">Transactions: <br><br>Active contracts: <br><br>Return value: &quot;ok&quot;<br><br></div></body></html>
